// src/App.jsx
import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";

// Components
import Navbar from "./components/Navbar";
import Sidebar from "./components/Sidebar";

// Pages
import Landing from "./pages/Landing/Landing";
import Dashboard from "./pages/Dashboard/Dashboard";
import RoommateMatch from "./pages/RoommateMatch/RoommateMatch";
import CompareView from "./pages/RoommateMatch/CompareView";
import Profile from "./pages/Profile/Profile";
import Questionnaire from "./pages/Questionnaire/Questionnaire";

const App = () => {
  return (
    <Router>
      <div className="app-container">
        <Navbar />
        <div className="main-layout">
          <Sidebar />
          <main className="main-content">
            <Routes>
              <Route path="/" element={<Landing />} />
              <Route path="/dashboard" element={<Dashboard />} />
              <Route path="/matches" element={<RoommateMatch />} />
              <Route path="/compare/:roommateId" element={<CompareView />} />
              <Route path="/profile" element={<Profile />} />
              <Route path="/questionnaire" element={<Questionnaire />} />
              <Route path="*" element={<Navigate to="/" replace />} />
              
            </Routes>
          </main>
        </div>
      </div>
    </Router>
  );
};

export default App;
